4 "\n">]>, #<Nokogiri::XML::Text:0x3fc56a0a3b8c "\n\n">, #<Nokogiri::XML::Element:0x3fc56a0a3678 name="div" attributes=[#<Nokogiri::XML::Attr:0x3fc56a0a340c name="class" value="UIWalkthrough-step UIWalkthrough-step--retweet">] children=[#<Nokogiri::XML::Text:0x3fc56a0a26c4 "\n  ">, #<Nokogiri::XML::Element:0x3fc56a0a25e8 name="h3" attributes=[#<Nokogiri::XML::Attr:0x3fc56a0a2570 name="class" value="UIWalkthrough-title">] children=[#<Nokogiri::XML::Text:0x3fc56a09bb80 "\n    ">, #<Nokogiri::XML::Element:0x3fc56a09b824 name="span" attributes=[#<Nokogiri::XML::Attr:0x3fc56a09b694 name="class" value="Icon Icon--retweet UIWalkthrough-icon">]>, #<Nokogiri::XML::Text:0x3fc56a0dfccc "\n    Difunde el mensaje\n  ">]>, #<Nokogiri::XML::Text:0x3fc56a0df81c "\n  ">, #<Nokogiri::XML::Element:0x3fc56a0df574 name="p" attributes=[#<Nokogiri::XML::Attr:0x3fc56a0df45c name="class" value="UIWalkthrough-message">] children=[#<Nokogiri::XML::Text:0x3fc56a0de610 "\n    La manera más rápida de compartir el Tweet de alguien con tus seguidores es con un Retweet. Pulsa el icono para enviarlo instantáneamente.\n  ">]>, #<Nokogiri::XML::Text:0x3fc56a0d3f44 "\n">]>, #<Nokogiri::XML::Text:0x3fc56a0d3a80 "\n\n">, #<Nokogiri::XML::Element:0x3fc56a0d38dc name="div" attributes=[#<Nokogiri::XML::Attr:0x3fc56a0d37b0 name="class" value="UIWalkthrough-step UIWalkthrough-step--reply">] children=[#<Nokogiri::XML::Text:0x3fc56a0d2db0 "\n  ">, #<Nokogiri::XML::Element:0x3fc56a0d2798 name="h3" attributes=[#<Nokogiri::XML::Attr:0x3fc56a0d2504 name="class" value="UIWalkthrough-title">] children=[#<Nokogiri::XML::Text:0x3fc56a0c771c "\n    ">, #<Nokogiri::XML::Element:0x3fc56a0c7564 name="span" attributes=[#<Nokogiri::XML::Attr:0x3fc56a0c73e8 name="class" value="Icon Icon--reply UIWalkthrough-icon">]>, #<Nokogiri::XML::Text:0x3fc56a0c6178 "\n    Únete a la conversación\n  ">]>, #<Nokogiri::XML::Text:0x3fc56a0bf850 "\n  ">, #<Nokogiri::XML::Element:0x3fc56a0bf3dc name="p" attributes=[#<Nokogiri::XML::Attr:0x3fc56a0bf1c0 name="class" value="UIWalkthrough-message">] children=[#<Nokogiri::XML::Text:0x3fc56a10b9f8 "\n    Di lo que opinas sobre cualquier Tweet con una respuesta. Encuentra un tema que te apasione, y únete a la conversación.\n  ">]>, #<Nokogiri::XML::Text:0x3fc56a10b458 "\n">]>, #<Nokogiri::XML::Text:0x3fc56a10aff8 "\n\n\n\n">, #<Nokogiri::XML::Element:0x3fc56a10a8a0 name="div" attributes=[#<Nokogiri::XML::Attr:0x3fc56a10a38c name="class" value="UIWalkthrough-step UIWalkthrough-step--trends">] children=[#<Nokogiri::XML::Text:0x3fc56a10326c "\n  ">, #<Nokogiri::XML::Element:0x3fc56a102fd8 name="h3" attributes=[#<Nokogiri::XML::Attr:0x3fc56a102d44 name="class" value="UIWalkthrough-title">] children=[#<Nokogiri::XML::Text:0x3fc56a0fad10 "\n    ">, #<Nokogiri::XML::Element:0x3fc56a0fa7d4 name="span" attributes=[#<Nokogiri::XML::Attr:0x3fc56a0fa5cc name="class" value="Icon Icon--discover UIWalkthrough-icon">]>, #<Nokogiri::XML::Text:0x3fc56a0f3600 "\n    Infórmate de lo más reciente\n  ">]>, #<Nokogiri::XML::Text:0x3fc56a0f3268 "\n  ">, #<Nokogiri::XML::Element:0x3fc56a0f30c4 name="p" attributes=[#<Nokogiri::XML::Attr:0x3fc56a0f2ffc name="class" value="UIWalkthrough-message">] children=[#<Nokogiri::XML::Text:0x3fc56a0f223c "\n    Consigue información instantánea sobre lo que las personas están hablando en este momento.\n  ">]>, #<Nokogiri::XML::Text:0x3fc56a0ebae0 "\n">]>, #<Nokogiri::XML::Text:0x3fc56a0eb4f0 "\n\n">, #<Nokogiri::XML::Element:0x3fc56a0eb220 name="div" attributes=[#<Nokogiri::XML::Attr:0x3fc56a0eb0a4 name="class" value="UIWalkthrough-step UIWalkthrough-step--wtf">] children=[#<Nokogiri::XML::Text:0x3fc56a1222e8 "\n  ">, #<Nokogiri::XML::Element:0x3fc56a123e18 name="h3" attributes=[#<Nokogiri::XML::Attr:0x3fc56a123cd8 name="class" value="UIWalkthrough-title">] children=[#<Nokogiri::XML::Text:0x3fc56a1231ac "\n    ">, #<Nokogiri::XML::Element:0x3fc56a122db0 name="span" attributes=[#<Nokogiri::XML::Attr:0x3fc56a122c98 name="class" value="Icon Icon--follow